let ASIM_GetWindowsUserType = (username:string, sid:string) { 
    case ( 
        username endswith "$" or sid in ("S-1-5-18", "S-1-5-19", "S-1-5-20"), "Machine"
        , isempty(username) or sid == "S-1-0-0", ""
        , "Regular"
    )
};
ASIM_GetWindowsUserType(username,sid)
